import LoginForm from './components/usersLogin';
import RegisterForm from './components/userRegister';
import AdminLogin from './Admin/adminLogin';
import TaskManagement from './Admin/taskManagement';
import Lecturers from './Admin/lectures';
import Users from './Admin/usersManagement';
import Tasks from './Lecturers/task';
import Submssion from './Lecturers/submission';
import StudentsTasks from './students/tasks';
import SubmissionTasks from './students/submit';
import Navigation from './components/navigation';
import { useState } from 'react';

function App() {
  const [isAdminLoggedIn, setIsAdminLoggedIn] = useState(false);

  // Function to handle login
  const handleAdminLogin = () => {
    setIsAdminLoggedIn(true);
  };

  return (

    <Router>
      <div className="App">
        <Routes>
          {/* Admin Dashboard Routes */}
          <Route
            path="/admin/*"
            element={
              isAdminLoggedIn ? (
                <div className="flex h-screen">
                  {/* Sidebar */}
                  <AdminSidebarNavigation />
                  {/* Main Content */}
                  <div className="w-3/4 p-6 overflow-y-auto">
                    <Routes>
                      <Route path="tasks" element={<TaskManagement />} />
                      <Route path="lectureres" element={<Lecturers />} />
                      <Route path="users" element={<Users />} />

                    </Routes>
                  </div>
                </div>
              ) : (
                <Navigate to="/admin/login" />
              )
            }
          />
          <Route
            path="/admin/login"
            element={
              isAdminLoggedIn ? (
                <Navigate to="/admin/users" />
              ) : (
                <AdminLogin onLogin={handleAdminLogin} />
              )
            }
          />

          {/* lectures dashboard*/}
          <Route
            path="/*"
            element={
              <>
                <Navigation />
                <Routes>
                <Route path="/sign in" element={<LoginForm />} />
                <Route path="/register" element={<RegisterForm />} />
                <Route path="/lecturesTask" element={<Tasks />} />
                <Route path="/submissions" element={<Submssion />} />

                </Routes>
              </>
            }
          />

            {/* students dashboard*/}
            <Route
            path="/*"
            element={
              <>
                <Navigation />
                <Routes>
                 <Route path="/sign in" element={<LoginForm />} />
                 <Route path="/register" element={<RegisterForm />} />
                 <Route path="/studentsTasks" element={< StudentsTasks/>} />
                 <Route path="/submit" element={<SubmissionTasks />} />

                </Routes>
              </>
            }
          />
        </Routes>


      </div>
    </Router>
  );
}

export default App;
